// Skills.js
import React from "react";
import "./../styles/skills.css"; // Make sure the path is correct

const Skills = () => {
  const skills = [
    { name: "C", image: "data:image/jpeg;base64," },
    { name: "C++", image: "data:image/png;base64," },

    { name: "Python", image: "data:image/png;base64," },

    { name: "HTML", image: "data:image/png;base64," },
    {name:"Java",image:"data:image/png;base64,"},
    { name: "CSS", image: "data:image/png;base64," },
    { name: "JavaScript", image: "data:image/jpeg;base64," },
    { name: "MySQL", image: "data:image/png;base64," },
    { name: "GitHub", image: "data:image/png;base64," },
    { name: "VS Code", image: "data:image/jpeg;base64," },
    { name: "Jupyter Notebook", image: "data:image/png;base64," },
    { name: "MIT App Inventor", image: "data:image/png;base64," },
  ];

  return (
    <div className="skills">
      <h2 className="skills-title">My Skills</h2>
      <div className="skills-container">
        {skills.map((skill, index) => (
          <div key={index} className="skill-box">
            <img src={skill.image} alt={skill.name} />
            <h3>{skill.name}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Skills;